import TypingCustom from './TypingCustom'
import Link from 'next/link';
import Fade from 'react-reveal/Zoom';

const Header = () => (
    <div className='outestdiv'>
        <div className='outerdiv'>
            <div className='titlelogo'>
                <Link href='/'>
                    <a>slern.io</a>
                </Link>
            </div>
            <div className='signin'>
                <button>
                    <Link href='/login'>
                        <a>Sign In</a>
                    </Link>
                </button>
            </div>
        </div>
        <div className='tagline'>
            <p>
                for <Fade>
                    cs_students
            </Fade>
            </p>

        </div>


        <style jsx>{`
        .outestdiv {
            background: rgb(225,225,246);
            background: linear-gradient(180deg, rgba(225,225,246,1) 0%, rgba(155,238,255,1) 100%);

        }
        .tagline {
            text-align: center;
            padding-bottom: 50px;
            color: #486491;
            font-size: 40px;
            font-weight: 700;
            line-height: 1.5;
            font-family: Courier; 
            display: inline-block;
        }

        .outerdiv {
            width: 100%;
            height: 100px;
            display: grid;
            font-family: Arial; 
            grid-template-columns: 95% 5%;
            font-size: 20px;

        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-left: 5px;
            margin-top: 5px;
        }
        .signin {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-top: 5px;
            font-size: 20px;
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }

          a:hover {
            opacity: 0.6;
          }
          body {
            margin:0;
            padding:0;
          }

        `}</style>
    </div>
);

export default Header;
